// Scrolljacking and animations for Slide 2

export const slideTwoPlx = [
  {
    start: '.sticky-trigger-1',
    duration: '1',
    properties: [
      {
        startValue: 0,
        endValue: 1,
        property: 'opacity',
      },
    ],
  },
  {
    start: '.sticky-trigger-1',
    duration: '20vh',
    properties: [
      {
        startValue: 0,
        endValue: -18,
        unit: 'vh',
        property: 'translateY',
      },
    ],
  },
  {
    start: '.sticky-trigger-1',
    startOffset: '20vh',
    duration: '40vh',
    properties: [
      {
        startValue: -18,
        endValue: -10,
        unit: 'vh',
        property: 'translateY',
      },
    ],
  },
  {
    start: '.sticky-trigger-1',
    startOffset: '120vh',
    duration: '100vh',
    properties: [
      {
        startValue: -10,
        endValue: -100,
        unit: 'vh',
        property: 'translateY',
      },
    ],
  },
  {
    start: '.sticky-trigger-1',
    startOffset: '220vh',
    duration: '1',
    properties: [
      {
        startValue: 1,
        endValue: 0,
        property: 'opacity',
      },
    ],
  },
];

export const vehicleSlideShowPlx = [
  {
    start: '.sticky-trigger-1',
    duration: '20vh',
    properties: [
      {
        startValue: 0.2,
        endValue: 1,
        unit: 'vh',
        property: 'scaleX',
      },
    ],
  },
];

export const slideTextPlx = [
  {
    start: '.sticky-trigger-1',
    startOffset: '10vh',
    duration: '10vh',
    properties: [
      {
        startValue: 0,
        endValue: 1,
        property: 'opacity',
      },
    ],
  },
]

export const vehiclePicPlx = [
  {
    start: '.sticky-trigger-1',
    duration: '20vh',
    properties: [
      {
        startValue: 50,
        endValue: 0,
        unit: 'vh',
        property: 'translateX',
      },
      {
        startValue: 0,
        endValue: 1,
        property: 'opacity',
      },
    ],
  },
];

// Scrolljacking and animations for Slide 3
export const slideThreePlx = [
  {
    start: '.sticky-trigger-2',
    duration: '1',
    properties: [
      {
        startValue: 0,
        endValue: 1,
        property: 'opacity',
      },
    ],
  },
];

export const mapPlx = [
  {
    start: '.sticky-trigger-2',
    duration: '1',
    properties: [
      {
        startValue: 0,
        endValue: 1,
        property: 'opacity',
      },
    ],
  },
  {
    start: '.sticky-trigger-2',
    duration: '40vh',
    properties: [
      {
        startValue: 0,
        endValue: -100,
        unit: '%',
        property: 'translateX',
      },
    ],
  },
  {
    start: '.sticky-trigger-2',
    duration: '40vh',
    properties: [
      {
        startValue: 0,
        endValue: -15,
        unit: 'vh',
        property: 'translateY',
      },
    ],
  },
];

export const appPlx = [
  {
    start: '.sticky-trigger-2',
    startOffset: '35vh',
    duration: '20vh',
    properties: [
      {
        startValue: 0,
        endValue: 10,
        unit: 'vh',
        property: 'translateY',
      },
    ],
  },
  {
    start: '.sticky-trigger-2',
    startOffset: '35vh',
    duration: '20vh',
    properties: [
      {
        startValue: 0,
        endValue: 1,
        property: 'opacity',
      },
    ],
  },
]
